import React from 'react';

import { Menu, Row, Col, Button, Carousel } from 'antd';
//import { AppstoreOutlined, SettingOutlined } from '@ant-design/icons';
const Home = () => {
    const contentStyle = {
        height: '160px',
        color: '#fff',
        lineHeight: '1000px',
        textAlign: 'center',
        background: '#364d79',
      };
    return (
        <>
            <Carousel>
                <div>
                    <h3 style={contentStyle}>Hello</h3>
                </div>
            </Carousel>
        </>
    );
}

export default Home;
